import React from "react";

const StarLinkItem = (props) => {
  return (
    <div>
      <div class="card bg-dark mx-3">
        <div class="card-body">
          <h5 class="card-title">
            Special title treatment {props.name} {props.version}
          </h5>
          <p class="card-text">
            With supporting text below as a natural lead-in to additional
            content.
          </p>
          <a href="#" class="btn btn-primary">
            Go somewhere
          </a>
        </div>
      </div>
    </div>
  );
};

export default StarLinkItem;
